import ReactDOM from 'react-dom';

class Ticket extends React.Component{

  render()
  {
    return(
      <div>
        <div class="inner_wrap">
          <div class="container">
            <h2 class="text-center">Ticket History</h2>
          </div>
        </div>
      </div>
    )
  }
}
export default Ticket;
